import React from 'react';
import TreatmentButton from '../TreatmentButton/TreatmentButton';
import './TreatmentButtonsList.css';

const TreatmentButtonsList = props => {
  const listOfTreatmentButtons = props.labels.map( (currentLabel, i) => {
    return (
      <TreatmentButton
        icon={props.icons[i]}
        label={currentLabel}
        isChecked={props.isChecked[i]}
        onClick={props.onClick}
        key={currentLabel + i}
      />
    );
  });
  return(
    <div className="TreatmentButtonsList-wrapper">
      {listOfTreatmentButtons}
    </div>
  );
};

export default TreatmentButtonsList;
